import React, { useCallback } from 'react';
import ReactFlow, {
  ReactFlowProvider,
  addEdge,
  MiniMap,
  Background,
  Controls,
  Connection,
  Edge,
  Node,
  applyEdgeChanges,
  applyNodeChanges,
  ConnectionMode,
  useEdgesState,
  useNodesState,
} from 'reactflow';
import 'reactflow/dist/style.css';
import { zinc } from 'tailwindcss/colors';
import { Square } from './FlowJam/Nodes/Square';
import { DefaultEdge } from './FlowJam/Edges/DefaultEdges';

const NODE_TYPES = {
   square: Square, 
}

const EDGE_TYPES = {
    default: DefaultEdge,
}

const INITIAL_NODES = [
    {
        id: crypto.randomUUID(),
        type: "square",
        position: {
            x: 200,
            y: 400,
        },
        data: {},
    },
    {
        id: crypto.randomUUID(),
        type: "square",
        position: {
            x: 1000,
            y: 400,
        },
        data: {},
    },
] satisfies Node[]

const OldFluxograma: React.FC = () => {
    const [edges, setEdges, onEdgesChange] = useEdgesState([]);
    const [nodes, setNodes, onNodesChange] = useNodesState(INITIAL_NODES);

    const onConnect = useCallback((params: Connection) => {
        return setEdges((eds) => addEdge(params, eds))
    }, [setEdges]);

    return (
        <div className='w-screen h-screen'>
            <ReactFlow
                nodeTypes={NODE_TYPES}
                edgeTypes={EDGE_TYPES}
                nodes={nodes}
                edges={edges}
                onEdgesChange={onEdgesChange}
                onConnect={onConnect}
                onNodesChange={onNodesChange}
                connectionMode={ConnectionMode.Loose}
                defaultEdgeOptions={{
                    type: 'default',
                }}
            >
                <Background 
                    gap={12}
                    size={12}
                    color={zinc[100]}
                />
                <Controls />
            </ReactFlow>
        </div>
    )
};

export default OldFluxograma;
